import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Nav = () => {
  return (
    <div className="s-container">
      <div className="pagelogo-wrapper">
        <h3>Careers</h3>
      </div>
      <div className="nav-wrapper">
        <ul>
          <li>
            <span>Solution</span>
          </li>
          <li>
            <span>Pricing</span>
          </li>
          <li>
            <span>Resources</span>
          </li>
          <li>
            <span>Company</span>
          </li>
        </ul>
      </div>
      <style jsx>
        {`
          .s-container {
            font-size: 14px;
            width: 100vw;
            height: 100px;
            background-color: white;
            color: pink;
            display: grid;
            grid-template-columns: 0.2fr 1fr;
            margin: auto;
            text-align: center;
            font-size: 14px;
            padding: 0;
            margin: 0;
          }
          .s-container ul {
            display: flex;
            flex-direction: row;
            list-style: none;
          }

          .s-container span {
            padding-left: 30px;
          }
        `}
      </style>
    </div>
  );
};

export default Nav;
